import './App.css';
import Nav from './Components/Navigation/NavBar';
import HeroHome from './Components/HomePage/HeroHome';
import Footer from './Components/Navigation/Footer'
import Carousel from './Components/HomePage/HomePageCarousel';

function App() {
  return (
    <div >
      <Nav/>
      <div>
        <HeroHome/>
        <Carousel/>
        <Footer/>
      </div>
    </div>
  );
}

export default App;
